DEF SYS_PRINT_ROW_PASS_2           EQU 1

DEF SYS_REPLY_BUFFER_SEND_AND_CHECKSUM_OK             EQU $01
DEF SYS_REPLY_BOOT_OK             EQU $01  ; Reply on startup that allows rest of code to proceed
